import React from 'react';
import ReactDOM from 'react-dom';

import App from './App';

let json = require('./data.json');
const TRENI = json.treni;

let lista = require('./data-2.json');
let stazioni = [];
lista.treni.forEach(tratta => {
    tratta.fermate.forEach(fermata => {
        if(!stazioni.includes(fermata.stazione)) stazioni.push(fermata.stazione);
    })
});
console.log(stazioni);

ReactDOM.render(<App treni={TRENI} />, document.getElementById('root'));
